import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <script
          defer="defer"
          src="https://hlive.azureedge.net/hlive-button-script/minichat.bundle.js"
        ></script>
      </header>
      <body>
        <script>
          {document.addEventListener("DOMContentLoaded", function () {
            var hchat = new HliveChat();
          })}
        </script>
      </body>
    </div>
  );
}

export default App;
